import React from 'react';
import '../App.css';

function Hr() {
    return (    
          <hr  style={{
              color: '#000000',
              backgroundColor: '#000000',
              height: .5,
              borderColor : '#000000',
              width : '50%'
          }}/>
    );
  }
  
  export default Hr;
